import React from 'react'
import { Link } from 'react-router-dom'

const Nav = () => {
  return (
    <nav>
      <Link to='/'>Home</Link>
      <Link to='/profile'>Profile</Link>
      <Link to='/protected'>Protected</Link>
    </nav>
  )
}

export default Nav
